  const kissKissAmountRef = useEffect(null);
  const ululeAmountRef = useEffect(null);
  const kissKissUpdate = useEffect(null);
  const ululeUpdate = useEffect(null);
  useEffect(() => {});
  return (
    <Layout>
      <h1>Projets populaires</h1>
      <h2>Argent collecté en temps réel</h2>
      <ul>
        <li>
          KissKissBankBank : <span ref={kissKissAmountRef}>0</span>€ -
          <span ref={kissKissUpdate} />
        </li>
        <li>
          Ulule : <span ref={ululeAmountRef}>0</span>€ -
          <span ref={ululeUpdate} />
        </li>
      </ul>
    </Layout>
  );
}

export default HomePage;
